lxb_css_parser_state_f
lxb_css_property_state_text_emphasis_position(lxb_css_parser_t *parser, lxb_css_syntax_token_t *token,
                      void *ctx, lxb_css_syntax_token_t **out_token)
{
    lxb_css_property_text_emphasis_position_t *property = lxb_css_parser_create_property_placeholder(parser, offsetof(lxb_css_property_t, text_emphasis_position));
    if (property == NULL) {
        return lxb_css_parser_memory_fail(parser);
    }

    lxb_css_syntax_token_t *ident;
    const lxb_char_t *name;
    size_t length;

    if (token->type == LXB_CSS_SYNTAX_TOKEN_IDENT) {
        ident = token;
        name = lxb_css_syntax_token_ident_data(ident);
        length = lxb_css_syntax_token_ident_length(ident);
        if (lxb_css_property_state_eq(name, length, "over", 4)) {
            property->type = LXB_CSS_TEXT_EMPHASIS_POSITION_OVER;
        }
        else if (lxb_css_property_state_eq(name, length, "under", 5)) {
            property->type = LXB_CSS_TEXT_EMPHASIS_POSITION_UNDER;
        }
        else if (lxb_css_property_state_eq(name, length, "right", 5)) {
            property->type = LXB_CSS_TEXT_EMPHASIS_POSITION_RIGHT;
        }
        else if (lxb_css_property_state_eq(name, length, "left", 4)) {
            property->type = LXB_CSS_TEXT_EMPHASIS_POSITION_LEFT;
        }
        else {
            lxb_css_parser_warning(parser, LXB_CSS_PARSER_WARNING_PROPERTY_INVALID_VALUE, token);
            lxb_css_parser_destroy_property_placeholder(parser);
            return lxb_css_parser_state_element_skip_to_semicolonp;
        }
    }
    else {
        lxb_css_parser_warning(parser, LXB_CSS_PARSER_WARNING_PROPERTY_INVALID_VALUE, token);
        lxb_css_parser_destroy_property_placeholder(parser);
        return lxb_css_parser_state_element_skip_to_semicolonp;
    }

    *out_token = lxb_css_parser_token_consume(parser);
    return lxb_css_parser_state_element_return_to_parent;
}


